import React from "react";
import "./sidebar.css";
import { ContentCopy, TextFields, Gradient } from "@mui/icons-material";

export default function SideBar() {
  return (
    <div className="sideWrapper">
      <ul className="tools">
        <li>
          <ContentCopy /> Box Shadow
        </li>
        <li>
          {/* <img
            src={require("../../assets/images/icons/icons8-text-49.png")}
            alt=""
            width={25}
          /> */}
          <TextFields />
          Text Shadow
        </li>
        <li>
          <Gradient />
          Gradient
        </li>
        <li>
          <img
            src={require("../../assets/images/icons/icons8-cursor-26.png")}
            alt=""
            width={15}
          />
          cursor
        </li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
      </ul>
    </div>
  );
}
